queries.sql:
select c.category, p.id, p.title, u.username, p.created_at 
		from categories as c right join posts as p on p.category = c.id 
		left join users as u on u.id = p.autor where p.created_at between &quot;2023/01/01&quot; and &quot;2023/12/31&quot;

